Δεδομένου ότι Ήταν μια καστανή με μακριά μαλλιά, χυμώδες πρόσωπο, σαρκώδη χείλη και μεγάλα δόντια. προκύπτει ότι Είχε καστανά μαλλιά και κάποια δόντια στο στόμα της. Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Αν είναι λάθος να παραχωρήσετε στον πλοίαρχο Blood προμήθεια, το λάθος δεν είναι δικό μου. προκύπτει ότι Υπήρξε το ενδεχόμενο σφάλματος καθώς ο λογιστής πρόσφατα απολύθηκε. Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Περισσότερο Κεφαλαιοποιώντας τις διαταραγμένες σχέσεις μεταξύ της British Telecom και της MCI, η WorldCom υπερέβη την προσφορά της BT προσφέροντας 30 δισεκατομμύρια δολάρια για την MCI. προκύπτει ότι Το WorldCom είναι σε δημοπρατικό πόλεμο με την BT. Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. προκύπτει ότι Δεν του μίλησα ξανά. Ναι, όχι, ή ίσως;
